var logo ="data:image/png;base64,";
var loading_bg ="data:image/png;base64,";


var GameLoadingScene = cc.Scene.extend({

    _label:null,
    resCount:0,
    resLoadedCount:0,
    labelProgress:null,
    layerProgress:null,
    _visableBarRec:null,
    layerProgressCount:null,

    init:function(){
        this._super();

        var self = this;
        var size = cc.director.getWinSize();
        var fontSize = 24;
        var logoWidth = 259;
        var logoHeight = 214;

        var progressBarWidth = 352;
        var progressBarHeight = 55;

        // bg
        var bgLayer = self._bgLayer = new cc.LayerColor(cc.color(32, 32, 32, 255));
        self.addChild(bgLayer, 0);

        var logo = new cc.Sprite(res.logo);
        logo.setAnchorPoint(new cc.Point(0.5,0.5));
        logo.setPosition(new cc.Point(size.width/2,size.height/2))

        bgLayer.addChild(logo,0);
        logo.runAction(cc.sequence(new cc.ScaleTo(0.1,1.0,1.0),new cc.ScaleTo(0.1,0.5,0.5),
            new cc.ScaleTo(0.1,1.0,1.0),new cc.ScaleTo(0.1,0.7,0.7),new cc.ScaleTo(1.0,1.2,1.2)));

        //progress bar
        var progress_bg  = new cc.Sprite(res.progressbar_bg);
        progress_bg.setAnchorPoint(new cc.Point(0.5,0.5));
        progress_bg.setPosition(new cc.Point(size.width/2,size.height/2 - logoHeight/2 -50));
        bgLayer.addChild(progress_bg,10);

        //progress bar
        var progress_front = self.layerProgress = new cc.Sprite(res.progressbar_front);
        progress_front.setAnchorPoint(new cc.Point(0.0,0.5));
        progress_front.setPosition(new cc.Point(size.width/2-355/2 +2,size.height/2 - logoHeight/2 -50));
        self._visableBarRec = cc.rect(0,0,0,progressBarHeight);
        progress_front.setTextureRect(self._visableBarRec);
        bgLayer.addChild(progress_front,11);

        //loading percent
        var label = self._label = new cc.LabelTTF("Loading... 0%", "Arial", fontSize);
        label.setPosition(new cc.Point(size.width/2,size.height/2 - logoHeight/2 -100));
        label.setColor(cc.color(255, 255, 255));
        bgLayer.addChild(this._label, 10);

        var btn_start  = new cc.MenuItemImage(res.btn_start, res.btn_start, self.menuCallBack, self);
        btn_start.setPosition(size.width / 2, size.height/2 - logoHeight/2 -150);
        var menu = new cc.Menu(btn_start);
        menu.setPosition(0, 0);		// 这里设置位置貌似没什么用处
        bgLayer.addChild(menu);

        return true;
    },

    menuCallBack:function(){
        var welComeLayer = new GameWelComeLayer();
        var scenc = new cc.Scene();
        scenc.addChild(welComeLayer);
        cc.audioEngine.playMusic("res/music/battle_begin_01.mp3", false);//"res/music/battle_begin_01.mp3"
        cc.director.runScene(new cc.TransitionFade(1,scenc,cc.TRANSITION_ORIENTATION_LEFT_OVER));
    },

    _initStage: function (img, centerPos) {
        var self = this;
        var texture2d = self._texture2d = new cc.Texture2D();
        texture2d.initWithElement(img);
        texture2d.handleLoadedTexture();
        var logo = self._logo = new cc.Sprite(texture2d);
        logo.setScale(cc.contentScaleFactor());
        logo.x = centerPos.x;
        logo.y = centerPos.y;
        self._bgLayer.addChild(logo, 10);
    },

    onEnter:function(){
        var self = this;
        cc.Node.prototype.onEnter.call(self);
        self.schedule(self._startLoading, 0.3);
    },

    onExit:function(){
        cc.Node.prototype.onExit.call(this);
        var tmpStr = "Loading... 0%";
        this._label.setString(tmpStr);
    },

    initWithResources: function (resources, cb) {
        if(cc.isString(resources))
            resources = [resources];
        this.resources = resources || [];
        this.cb = cb;
    },

    _startLoading: function () {
        var self = this;
        self.unschedule(self._startLoading);

        var res = self.resources;
        cc.loader.load(res,
            function (result, count, loadedCount) {
                //cc.log(loadedCount +"/" +count);
                var percent = ((loadedCount+1) / count * 100) | 0;
                percent = Math.min(percent, 100);
                var per = parseInt(352*percent/100);

                self._visableBarRec = cc.rect(0,0,per,55);

                self._label.setString("Loading... " + percent + "%");
                self.layerProgress.setTextureRect(self._visableBarRec);
            }, function () {
                if (self.cb)
                    self.cb();
            });
    }



});

GameLoadingScene.preLoad = function(resources, cb){

    if(!cc.loaderScene) {
        cc.loaderScene = new GameLoadingScene();
        cc.loaderScene.init();
    }
    cc.loaderScene.initWithResources(resources, cb);

    cc.director.runScene(cc.loaderScene);
    return cc.loaderScene;
};